import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './pages/Login';
import Register from './pages/Register';
import AdminPanel from './pages/AdminPanel';
import TenantView from './pages/TenantView';
import LandlordView from './pages/LandlordView';
import SmartFeatures from './pages/SmartFeatures';
import ProtectedRoute from './components/ProtectedRoute';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/admin" element={<ProtectedRoute role="admin"><AdminPanel /></ProtectedRoute>} />
        <Route path="/tenant" element={<ProtectedRoute role="tenant"><TenantView /></ProtectedRoute>} />
        <Route path="/landlord" element={<ProtectedRoute role="landlord"><LandlordView /></ProtectedRoute>} />
        <Route path="/smart" element={<ProtectedRoute><SmartFeatures /></ProtectedRoute>} />
      </Routes>
    </Router>
  );
}

export default App;
